import './Footer.css';
import { FaGithub, FaLinkedin, FaInstagram } from 'react-icons/fa';

function Footer() {
  return (
    <footer className="footer">
      <ul className="social-list">
        <li>
          <FaGithub />
        </li>
        <li>
          <FaLinkedin />
        </li>
        <li>
          <FaInstagram />
        </li>
      </ul>
      <p className="copy-right">
        Let√≠cia Chaves &copy; 2023. All Rights Reserved
      </p>
    </footer>
  );
}

export default Footer;
